import axios from 'axios';
import React from 'react'
import './Pages.css';

class OurCoaches extends React.Component {

    constructor(props){
        super(props);
        this.state = 
        {
            Coach: [],
        }
    }

    async FetchCoaches() {
        await axios.get("http://localhost:8080/coach/getCoach")
        .then((res) => {
            this.setState({
                Coach: res.data
            })
        });
    }

    componentDidMount(){
        this.FetchCoaches();
    }

    render() {
    return (
        <div className='coaches'>
            <div className='coaches-container'>
                <h1>GoForFit Coaches:</h1>
                <br/>
                {this.state.Coach.map(coach => {
                    coach.array.forEach(element => {
                        <p>{element}</p>
                    });
                })}
            </div>
        </div>
    )
    }
}

export default OurCoaches
